import { useState } from "react";

const [click, setClick] = useState("hola");
const Prueba = () => {
  function probar() {
    setClick(click);

    return (
      <>
        <h1>{probar}</h1>
        <button onClick={probar}>Probar</button>
      </>
    );
  }
};

export default Prueba;
